import BD1 from './assets/dice-blue-1.svg';
import BD2 from './assets/dice-blue-2.svg';
import BD3 from './assets/dice-blue-3.svg';
import BD4 from './assets/dice-blue-4.svg';
import BD5 from './assets/dice-blue-5.svg';
import BD6 from './assets/dice-blue-6.svg';
import RD1 from './assets/dice-red-1.svg';
import RD2 from './assets/dice-red-2.svg';
import RD3 from './assets/dice-red-3.svg';
import RD4 from './assets/dice-red-4.svg';
import RD5 from './assets/dice-red-5.svg';
import RD6 from './assets/dice-red-6.svg';

const DICE_IMAGES = {
    blueDice : [BD1,BD2,BD3,BD4,BD5,BD6],
    redDice :[RD1, RD2,RD3, RD4, RD5,RD6] 
}

function Dice( {color, num} ) {
    const src = DICE_IMAGES[color][num - 1];
    const alt = `${color} ${num}`
    return <img src={src} alt={alt} />   
}

export default Dice;
